original_question:
त्रिकोण $ABC$ समद्विबाहु आहे, ज्यामध्ये $AB=AC$ आणि उंची $AM=11$ आहे. गृहीत धरा की $\overline{AM}$ वर $D$ बिंदू आहे ज्यामध्ये $AD=10$ आणि $\angle BDC=3\angle BAC.$ त्रिकोण $ABC$ ची परिमिती शोधा.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

